        <div className="card text-white bg-success mb-3">
            <div className="card-header">
                Precio del Bitcoin: {price}
            </div>
            <div className="card-body">
                <h4 className="card-tittle">Precio Actual del Bitcoin:</h4>
            </div>
        </div>
    )
}

